In this lab, we will use Azure Database for MySQL as our database engine. There is an Azure Database for MySQL instance in your Azure subscription. We need to prepare the database on it for our code. Open browser and explore https://portal.azure.com , sign in with the Azure account provided. Click Resource groups > [the name of the resource group] . You will see 4 resources which look similar to the following screenshot. Azure Resources Click the name of Azure Database for MySQL server to view its details. Click Cloud Shell button Cloud Shell to open the cloud shell. Select Bash as the shell environment. [!NOTE] You might have to initialize the Cloud Shell and configure the storage account that it needs to use. If prompt, choose Show advanced settings , and then choose to use existing resource group and storage account, and create a new file share. See screenshot below as a reference. Initialize cloud shell In cloud shell window, connect to MySQL server with the following command: mysql --host [mysql server name].mysql.database.azure.com --user dbadmin@[mysql server name] -p You can find [mysql server name] from the Overview page of your Azure MySQL instance. See screenshot below as a reference. MySQL sign in When prompt, type the password P@ssw0rd1. When you connect to MySQL server successfully, type the following command to view all existing databases. show databases; Type the following SQL script to prepare for the database that we will use in our code later. CREATE DATABASE tododb;
CREATE USER 'springuser'@'%' IDENTIFIED BY 'Spring1234';
GRANT ALL PRIVILEGES ON tododb.* TO 'springuser'@'%';
FLUSH PRIVILEGES; After running the above script, if you run show databases; again, you will see a new database created. Type quit; to close the connection, and then close the cloud shell window. Click Connection security of Azure MySQL instance, turn on Allow access to Azure services and click Save . See screenshot below. Connection security

