Let's add a simple web controller to handle the web request. In VS Code, create a new file, HelloController.java, in the folder src/main/java/com/azurelabs/hellospringboot . In this new file, write the following code: [!NOTE] Type the code to try the Java coding experience in VS Code. package com.azurelabs.hellospringboot; import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RestController; @RestController
public class HelloController { @RequestMapping("/") public String Index() { return "Hello, Spring Boot!"; }
} With the above code, we have a simple web controller that can handle the request. To test the application locally, open the Terminal in VS Code by clicking View > Terminal or pressing Ctrl+` . In the Terminal, run command .\mvnw spring-boot:run. This command will compile the code and run it. When the project is running successfully, you will see the output in the Terminal which is similar as Started DemoApplication in 11.869 seconds (JVM running for 13.251) . Open a browser and visit http://localhost:8080. You should see a simple page as shown in the screenshot below. Hello, Spring Boot Close the browser, and stop the application by pressing Ctrl+C in Terminal.

