Follow the steps below to update the code and publish the web app to the Azure App Service. In VS Code, open application.properties file in src/main/resources folder. Instead of hard-coding the database connection string, we want to configure it via the Application Settings of Azure Web App. So discard the changes you made in section 2.1. The code of application.properties should look like the following which is the same as what you pulled from GitHub first time. spring.datasource.driver-class-name=com.mysql.cj.jdbc.Driver
spring.jpa.hibernate.ddl-auto=update
spring.jpa.properties.hibernate.dialect=org.hibernate.dialect.MySQL57InnoDBDialect
spring.datasource.url=${SPRING_DATASOURCE_URL}
spring.datasource.username=${SPRING_DATASOURCE_USERNAME}
spring.datasource.password=${SPRING_DATASOURCE_PASSWORD}
server.port=${PORT} In the Terminal window, run command, mvn clean package -DskipTests, to package the code. Find the package todowebjava-0.0.1-SNAPSHOT.jar in target folder. Right click and rename it to app.jar . In VS Code, click Azure icon on the left navigation to open App Service explorer, and then click Sign in to Azure . Click Copy & Open in the popup window. See screenshot below. A browser window will be opened. Azure Sign In In the browser window, right click in the Code input, select Paste to paste the device code, and click Continue button. See screenshot below as a reference. Device code Sign in with the Azure account. When you sign in successfully and see the following screen, close the browser window and go back to VS Code. Azure sign in complete In Azure App Service explorer, expand the corresponding subscription and locate the Azure Web App. See screenshot below. App service explorer Right click Application Settings and click Add New Setting . Follow the instruction to add the following application settings. Alternatively you can also add these settings in Azure Portal. |Name |Value | |---------------------------|---------| |SPRING_DATASOURCE_URL |jdbc:mysql:// [mysql server name] .mysql.database.azure.com:3306/tododb?useSSL=true&serverTimezone=UTC | |SPRING_DATASOURCE_USERNAME |springuser@ [mysql server name] | |SPRING_DATASOURCE_PASSWORD |Spring1234 | |PORT |80 | Replace [mysql server name] with your MySQL server name. For details about how to find [mysql server name] , please refer to Section 0.3 . In VS Code, switch to workspace Explorer by clicking the Explorer button on the left navigation or press Ctrl+Shift+E. Right click on app.jar and click Deploy to Web App . Follow the instruction to choose the Azure subscription, and the existing Web App. In this lab, we don't use Create New Web App option. In the popup dialog box, click Deploy button. The deployment process will be kicked off. You can open the Output window to see its progress. When you see the following popup, the deployment completes successfully. Click Browse Website button to browse the website. [!NOTE] You may have to restart the website in Azure Portal and wait for several minutes before you can see the home page of the website. Deploy success To verify if the site works properly, you can create a new task on the Todo page. Furthermore, you can use MySQL Workbench to connect to the MySQL server and query if the task you created is in the database.
